import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
  return (
    <>
      <div className="cards">
        <div className="card">
          <img
            src={props.im}
            alt="mypic"
            className="card_img"
          />
          <div className="card_info">
            <span className="card_category"></span>
            <h3 className="card_title"></h3>
            <a href="" target="blank">
              <button>Watch Now</button>
            </a>
          </div>
        </div>
      </div>
    </>
  );
}

ReactDOM.render(
  <>
    <Card imgsrc='https://wallpapercave.com/wp/wp4056401.png'
      title='A Netflix Original Searies'
    />
  </>,
  document.getElementById("root")
);
